import { useEffect } from "react"
import { useSelector } from "react-redux"
import Header from "./Header"

function Homepg(){

    const loginDetail = useSelector((state)=> state.user.loginSuccessData)

    useEffect(()=> {
        if(loginDetail.status == 201){
            alert("authenticated user")
        }
        else{
            alert("not an authenticated user")
        }
    },[])


    return(
        <>
            <Header />
            <h2>Welcome to homepage {loginDetail.sta}</h2>
            {JSON.stringify(loginDetail.data)}
        </>
    )
}

export default Homepg
